DELETE from SCHEMA.cptnacp where jaanne=2021;
UPDATE SCHEMA.FWINCP SET PINCVA = (SELECT COALESCE(MAX(JAITNA),0) FROM SCHEMA.CPTNACP) WHERE PINCID = 'CPTNACP';

DELETE from SCHEMA.cptrenp where jcanne=2021;
UPDATE SCHEMA.FWINCP SET PINCVA = (SELECT COALESCE(MAX(JCITRE),0) FROM SCHEMA.CPTRENP) WHERE PINCID = 'CPTRENP';

UPDATE SCHEMA.FWINCP SET PINCVA = (SELECT COALESCE(MAX(JBITIN),0) FROM SCHEMA.CPTINDP) WHERE PINCID = 'CPTINDP';


